import React, { useEffect, useState } from 'react'
import '../styles/Home.css'

// Add the User component
import UserProfile from '../components/user/UserProfile'
import UrlDashBoard from '../components/user/UrlDashBoard'

//import create url component
import CreateUrl from '../components/url/createUrl'

//Websockets for real time updates
const io = require('socket.io-client')
const socket = io('http://localhost:4000')

function Home () {
  return (
    <div>
      <UserProfile socket={socket} />
      <UrlDashBoard socket={socket} />
      <CreateUrl socket={socket} />
    </div>
  )
}

export default Home
